package ti.vision.utilities;

import android.graphics.Bitmap;
import android.graphics.BitmapFactory;
import android.util.Base64;

public class Appwerft {
	private final static String pureBase64Encoded = "";

	public Bitmap get() {
		return BitmapFactory.decodeByteArray(Base64.decode(pureBase64Encoded, Base64.DEFAULT), 0,
				Base64.decode(pureBase64Encoded, Base64.DEFAULT).length);
	}
}
